const e=JSON.parse('{"key":"v-6e2a864d","path":"/train/eda/chip-circuit/Part_4-chip_concepts/4_3_%E5%A4%A9%E7%BA%BF%E6%95%88%E5%BA%94.html","title":"4.3 天线效应","lang":"zh-CN","frontmatter":{"title":"4.3 天线效应","order":3},"headers":[{"level":2,"title":"1 什么是天线效应？","slug":"_1-什么是天线效应","link":"#_1-什么是天线效应","children":[{"level":3,"title":"(1) 互连制造过程","slug":"_1-互连制造过程","link":"#_1-互连制造过程","children":[]},{"level":3,"title":"(2) 等离子刻蚀","slug":"_2-等离子刻蚀","link":"#_2-等离子刻蚀","children":[]}]},{"level":2,"title":"2 天线效应产生的条件","slug":"_2-天线效应产生的条件","link":"#_2-天线效应产生的条件","children":[]},{"level":2,"title":"3 产生天线效应的评估条件","slug":"_3-产生天线效应的评估条件","link":"#_3-产生天线效应的评估条件","children":[]},{"level":2,"title":"4 如何预防天线违规？","slug":"_4-如何预防天线违规","link":"#_4-如何预防天线违规","children":[{"level":3,"title":"(1) 天线规则","slug":"_1-天线规则","link":"#_1-天线规则","children":[]},{"level":3,"title":"(2) 如何修复天线违规","slug":"_2-如何修复天线违规","link":"#_2-如何修复天线违规","children":[]},{"level":3,"title":"天线违规修复措施","slug":"天线违规修复措施","link":"#天线违规修复措施","children":[]}]},{"level":2,"title":"谢谢","slug":"谢谢","link":"#谢谢","children":[]}],"git":{"createdTime":1721213548000,"updatedTime":1721213548000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1}]},"readingTime":{"minutes":12.23,"words":3670},"filePathRelative":"train/eda/chip-circuit/Part_4-chip_concepts/4_3_天线效应.md","localizedDate":"2024年7月17日","excerpt":"<p>MOS晶体管的栅氧化物是MOS器件中最敏感的部分。在ASIC的制造过程中需要特别小心，以保护它免受制造过程和ASIC运行过程中的任何损坏。天线效应是一种现象，可能会在制造过程中对MOS的栅氧化物造成损害，特别是由于等离子刻蚀过程。在本文中，我们将详细调查天线效应现象及导致该效应的原因。</p>\\n<h2> 1 什么是天线效应？</h2>\\n<p>天线效应这个术语可能不会给您正确的直观感受，可能让您联想到电磁辐射或发射-接收概念，但这里情况不同。因此它还有另一个流行的名称，即“等离子诱导栅氧化物损伤”，这为该效应提供了正确的直觉。正如该名称本身所示，这是由于等离子刻蚀过程中对栅氧化物造成的损害所引起的效应。</p>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{e as data};
